# 3.2.3. Financial method 

To compute returns from individual funding rounds to exits (acquisitions or IPOs), the single case considered in this study, we take capital dilution into account. First, we calculate the equity value at the exit for an investor entered at a funding round $i$ :

$$
x_{i}=\underbrace{\frac{m_{i}}{v_{i}}}_{\begin{array}{c}
\text { initial stake } \\
\text { of investors i }
\end{array}} \times \underbrace{\frac{v_{i}-m_{i+1}}{v_{i+1}}}_{\begin{array}{c}
\text { proportion of old } \\
\text { equity at round } i+1
\end{array}} \times \ldots \times \underbrace{\frac{v_{n-1}-m_{n}}{v_{n}}}_{\begin{array}{c}
\text { proportion of old } \\
\text { equity at round } n
\end{array}}
$$

Where $m_{i}, m_{i+1}, \ldots, m_{n}$ are the amount raised from investors at each round, $v_{i}, v_{i+1}, \ldots, v_{n}$ is the equity value at each round, and $x_{i}$ is the percentage of equity owned by investors on

