Next, we use a similar approach to Cochrane (2005) [16]. We do not rely on his maximum likelihood approach as fewer observed returns with disaggregated sectors would make the optimizer convergence infeasible. Instead, we scale returns at the exit date by the time difference in days between the initial funding round and observed or inferred PMV and the exit time. We obtain implicit daily arithmetic returns that we convert into quarterly returns. We subsequently average these returns in each cybersecurity sector to obtain our time series of returns. Finally, the particularly skewed distribution of private equity returns imposes the use of a log model,

$$
\left\{\begin{array}{l}
\mathrm{d} \ln \mathrm{~V}=\left(\mathrm{r}^{\mathrm{f}}+\gamma\right) \mathrm{dt}+\delta\left(\mathrm{d} \ln \mathrm{~V}^{\mathrm{m}}-\mathrm{r}^{\mathrm{f}} \mathrm{dt}\right)+\sigma \mathrm{dB} \\
\mathrm{~d} \ln \mathrm{~V}^{\mathrm{m}}=\mu_{\mathrm{m}} \mathrm{dt}+\sigma_{\mathrm{m}} \mathrm{dB}^{\mathrm{m}}
\end{array}\right.
$$

Where dB is a standard Brownian motion, $V$ is the value of the asset (firm capital), $r^{f}$ is the risk-free rate, $\gamma$ the intercept, $\delta$ the slope, $V^{m}$ is the value of the market and $\sigma$ is the volatility of the value process. We follow Cochrane (2005) and assume $\left[B, B^{m}\right]_{t}=0$ [16]. In discrete time (for a time step $\Delta t=1$ ), the model is,

$$
\ln \left(\frac{V_{t+1}}{V_{t}}\right)=\ln R_{t+1}^{f}+\gamma+\delta\left(\ln R_{t+1}^{m}-\ln R_{t+1}^{f}\right)+\epsilon_{t+1}
$$

Where $\epsilon_{t+1} \sim \mathcal{N}\left(0, \sigma^{2} \Delta t\right), R_{t+1}^{f}=1+r_{t+1}^{f}$, and $R_{t+1}^{m}=1+\frac{V_{t+1}^{m}-V_{t}^{m}}{V_{t}^{m}}$ Thus, the value of the firm $V_{t+1}$ follows a log-normal distribution with parameters:

$$
\begin{aligned}
& \mu_{t+1}=\ln R_{t+1}^{f}+\gamma+\delta\left(\ln R_{t+1}^{m}-\ln R_{t+1}^{f}\right) \\
& \sigma_{t+1}^{2}=\sigma^{2}
\end{aligned}
$$

$$
\mathbb{E}[\ln r]=\gamma+\mu_{\ln r_{f}}+\delta\left(\mu_{\ln r_{M}}-\mu_{\ln r_{f}}\right)
$$

$$
\mathbb{V}[\ln r]=\delta^{2} \sigma_{\ln r_{M}}^{2}+\sigma^{2}
$$

Since we use a quarterly frequency, we multiply by four to annualize results and by 100 to get percentages. To get the results for the arithmetic returns, we take the expectation and variance of a log-normal variable, with $R=r+1$ and $\mu=\mathbb{E}[\ln R]$ :

$$
\begin{gathered}
\mathbb{E}[R]=\exp \left(\mu+\frac{1}{2} \sigma^{2}\right)-1 \\
\mathbb{V}[R]=\left(\exp \left(\sigma^{2}\right)-1\right) \exp \left(2 \mu+\sigma^{2}\right)=\left(\exp \left(\sigma^{2}\right)-1\right)(\mathbb{E}[R]+1)^{2}
\end{gathered}
$$
